description:
Je zou spontaan depressies kunnen krijgen van deze EP. Spinal en Steen zagen je kop doormidden met hun verschrikkelijke teksten en beukende beats.

Kadaverrap 1 uitgebracht in 2007 door Spinal en Steen is zeker niet geschikt voor tere zieltjes.

Tracklist:

01. Graven
02. Hier Een Pen
03. Mijn Huis
04. Haat
05. Sexslavin
06. Doe het
07. Kadaverrap

